import React from "react";

export default function Guitars() {
  return (
    <div className="p-6 max-w-3xl mx-auto">
      <h2 className="text-2xl font-semibold mb-4">Crafted Guitars</h2>
      <ul className="list-disc pl-6">
        <li>Petel: Telecaster with P90 neck pickup and single-coil bridge pickup. Swamp Ash body, maple neck and rosewood fingerboard. Tung oil finish. Kill switch instead of tone knob, and installed with bigsby bridge. Custom head shape. </li>
      </ul>
    </div>
  );
}
